```json
{
"application": "ParaView",
"details": {
"modules": ["openmpi/1.10.7/gcc-7.3.0", "gcc", "paraview"],
"environment": "OpenFOAM-dev",
"script": "pv_extract_analyze_script.py",
"resources": {
"queue": "high",
"job_name": "pvpost",
"partition": "standard",
"nodes": 1,
"time": "12:00:00",
"account": "bpms",
"output": "pv_post_log.out"
}
}
}
```

This script is running the ParaView application. It requires the OpenMPI 1.10.7 library with the gcc-7.3.0 compiler, the GCC compiler, and the ParaView module. It uses the OpenFOAM-dev environment and runs a Python script called "pv_extract_analyze_script.py". The script also uses Slurm to manage the execution, requesting resources like a high priority queue, a job name of "pvpost", a standard partition, 1 node, a time limit of 12 hours, an account named "bpms", and an output file called "pv_post_log.out".
